import React, { Component } from "react";

export default class PureComponent extends Component {
  constructor() {
    super();
    this.state = {
      data: 10,
    };
  }
  render() {
    console.log(this.state);
    return (
      <>
        <h1>Pure Component In React</h1>
        <h2>Data:{this.state.data}</h2>
        <button
          onClick={() => {
            this.setState({ data: 20 });
          }}
        >
          update data
        </button>
      </>
    );
  }
}
